schorn_stephan/status/1403030447723106310/photo/1\",\"display_url\":\"pic.twitter.com/40Q2OhKo7k\"}],\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchBinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":250,\"reply_count\":106,\"like_count\":1731,\"quote_count\":30},\"attachments\":{\"media_keys\":[\"3_1403030444157935619\"]},\"conversation_id\":\"1403030447723106310\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-10T16:45:00.000Z\",\"lang\":\"de\",\"author_id\":\"98178963\"},{\"text\":\"Hanna ist Biologin. Sie erforscht Phytoplanktons Photosynthese. Wenn Leute die Lösung der Klimakrise auf Wissenschaft &amp; Innovation schieben, meinen sie auch Hanna. Hanna hat davon nix. Sie sucht wieder Fördermittel. Und eine Stelle. Und eine Wohnung. Hanna ist müde. #IchbinHanna https://t.co/OKNafqzNUm\",\"id\":\"1403081616667385857\",\"entities\":{\"urls\":[{\"start\":284,\"end\":307,\"url\":\"https://t.co/OKNafqzNUm\",\"expanded_url\":\"https://twitter.com/FParianen/status/1403081616667385857/photo/1\",\"display_url\":\"pic.twitter.com/OKNafqzNUm\"},{\"start\":284,\"end\":307,\"url\":\"https://t.co/OKNafqzNUm\",\"expanded_url\":\"https://twitter.com/FParianen/status/1403081616667385857/photo/1\",\"display_url\":\"pic.twitter.com/OKNafqzNUm\"},{\"start\":284,\"end\":307,\"url\":\"https://t.co/OKNafqzNUm\",\"expanded_url\":\"https://twitter.com/FParianen/status/1403081616667385857/photo/1\",\"display_url\":\"pic.twitter.com/OKNafqzNUm\"},{\"start\":284,\"end\":307,\"url\":\"https://t.co/OKNafqzNUm\",\"expanded_url\":\"https://twitter.com/FParianen/status/1403081616667385857/photo/1\",\"display_url\":\"pic.twitter.com/OKNafqzNUm\"}],\"hashtags\":[{\"start\":271,\"end\":283,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":141,\"reply_count\":11,\"like_count\":1009,\"quote_count\":6},\"attachments\":{\"media_keys\":[\"3_1403081606307495936\",\"3_1403081609708965892\",\"3_1403081611927863298\",\"3_1403081614964445186\"]},\"conversation_id\":\"1403081616667385857\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-10T20:08:20.000Z\",\"lang\":\"de\",\"author_id\":\"1234226465534881793\"},{\"text\":\"Unter den Akademikern, die sich unter #IchbinHanna über den sozialen Abstieg beschwerten, waren sehr viele Frauen, die gegendert haben oder sowas in der Art studierten. Kunstgeschichtlerinnen heiraten Ärzte oder haben reiche Eltern, die haben das nicht nötig. https://t.co/yBVlOYZSwJ\",\"id\":\"1403605974200590338\",\"entities\":{\"urls\":[{\"start\":260,\"end\":283,\"url\":\"https://t.co/yBVlOYZSwJ\",\"expanded_url\":\"https://twitter.com/_donalphonso/status/1403605974200590338/photo/1\",\"display_url\":\"pic.twitter.com/yBVlOYZSwJ\"}],\"hashtags\":[{\"start\":38,\"end\":50,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":60,\"reply_count\":21,\"like_count\":555,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"3_1403605541990060034\"]},\"conversation_id\":\"1403605974200590338\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-12T06:51:56.000Z\",\"lang\":\"de\",\"author_id\":\"99718385\"},{\"text\":\"Sorry aber ich lache noch immer über diese personifizierten Fehlallokationen volkswirtschaftlicher Ressourcen, die unter #IchBinHanna ihr großes demonstratives Schaulaufen veranstalten. Wie sehr kann man eigentlich zu seiner eigenen, grob überzeichneten Karikatur erstarren? https://t.co/BtiHvqQJxH\",\"id\":\"1403099315040624643\",\"entities\":{\"urls\":[{\"start\":275,\"end\":298,\"url\":\"https://t.co/BtiHvqQJxH\",\"expanded_url\":\"https://twitter.com/Ruebenhorst/status/1403099315040624643/photo/1\",\"display_url\":\"pic.twitter.com/BtiHvqQJxH\"},{\"start\":275,\"end\":298,\"url\":\"https://t.co/BtiHvqQJxH\",\"expanded_url\":\"https://twitter.com/Ruebenhorst/status/1403099315040624643/photo/1\",\"display_url\":\"pic.twitter.com/BtiHvqQJxH\"},{\"start\":275,\"end\":298,\"url\":\"https://t.co/BtiHvqQJxH\",\"expanded_url\":\"https://twitter.com/Ruebenhorst/status/1403099315040624643/photo/1\",\"display_url\":\"pic.twitter.com/BtiHvqQJxH\"},{\"start\":275,\"end\":298,\"url\":\"https://t.co/BtiHvqQJxH\",\"expanded_url\":\"https://twitter.com/Ruebenhorst/status/1403099315040624643/photo/1\",\"display_url\":\"pic.twitter.com/BtiHvqQJxH\"}],\"hashtags\":[{\"start\":121,\"end\":133,\"tag\":\"IchBinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":81,\"reply_count\":35,\"like_count\":319,\"quote_count\":5},\"attachments\":{\"media_keys\":[\"3_1403098785144840195\",\"3_1403098785174142980\",\"3_1403098785161560065\",\"3_1403098785195216897\"]},\"conversation_id\":\"1403040872145489922\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"970421608362934272\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403040872145489922\"}],\"created_at\":\"2021-06-10T21:18:39.000Z\",\"lang\":\"de\",\"author_id\":\"970421608362934272\"},{\"text\":\"#IchbinHanna, aren't we all?\\nWe see that the insecurity limited and short-term contracts bring adds pressure and can be harmful for the mental well-being of our doctoral researchers.\\n\\nAn open-minded evaluation and change of the #WissZeitVG is needed to help Hanna! https://t.co/n4sxIComrP\",\"id\":\"1403277534465347585\",\"entities\":{\"annotations\":[{\"start\":258,\"end\":262,\"probability\":0.9689,\"type\":\"Person\",\"normalized_text\":\"Hanna\"}],\"urls\":[{\"start\":265,\"end\":288,\"url\":\"https://t.co/n4sxIComrP\",\"expanded_url\":\"https://twitter.com/maxplanckphdnet/status/1403277534465347585/photo/1\",\"display_url\":\"pic.twitter.com/n4sxIComrP\"}],\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"},{\"start\":228,\"end\":239,\"tag\":\"WissZeitVG\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":103,\"reply_count\":2,\"like_count\":251,\"quote_count\":11},\"attachments\":{\"media_keys\":[\"3_1403259270100049921\"]},\"conversation_id\":\"1403277534465347585\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-11T09:06:50.000Z\",\"lang\":\"en\",\"author_id\":\"1018174447281496064\"},{\"text\":\"Unter #IchbinHanna beschreiben Nachwuchswissenschaftler :innen, wie sie sich von einem befristetem Vertrag zum nächsten hangeln müssen.\\n\\nDie 200 häufigsten Wörter aus rund 20k Tweets:\\nhttps://t.co/WnTLVbvECr\\n\\n#rstats https://t.co/joGoVWvCMi\",\"id\":\"1403803240110637064\",\"entities\":{\"urls\":[{\"start\":184,\"end\":207,\"url\":\"https://t.co/WnTLVbvECr\",\"expanded_url\":\"https://bydata.github.io/ichbinhanna/wordcloud.html\",\"display_url\":\"bydata.github.io/ichbinhanna/wo…\",\"status\":200,\"title\":\"Wordcloud #IchBinHanna\",\"unwound_url\":\"https://bydata.github.io/ichbinhanna/wordcloud.html\"},{\"start\":217,\"end\":240,\"url\":\"https://t.co/joGoVWvCMi\",\"expanded_url\":\"https://twitter.com/_ansgar/status/1403803240110637064/photo/1\",\"display_url\":\"pic.twitter.com/joGoVWvCMi\"}],\"hashtags\":[{\"start\":6,\"end\":18,\"tag\":\"IchbinHanna\"},{\"start\":209,\"end\":216,\"tag\":\"rstats\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":6,\"reply_count\":3,\"like_count\":24,\"quote_count\":2},\"attachments\":{\"media_keys\":[\"16_1403800044617310210\"]},\"conversation_id\":\"1403803240110637064\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-12T19:55:48.000Z\",\"lang\":\"de\",\"author_id\":\"1139059532\"},{\"text\":\"Zu #IchBinHanna und prekärer Arbeit an Unis: »Das ist eben Wissenschaft – ein Kampf. Da mussten wir alle durch.« Genau das sei ein Problem, so Mia Feldmann, aufgrund dieser »Akademiker-Romantik« ändere sich nichts. Sie wünscht sich mehr #Solidarität:\\nhttps://t.co/Vzl5xgHnpk https://t.co/ho9jk5hbe7\",\"id\":\"1403301870119141377\",\"entities\":{\"urls\":[{\"start\":251,\"end\":274,\"url\":\"https://t.co/Vzl5xgHnpk\",\"expanded_url\":\"https://www.boeckler.de/de/magazin-mitbestimmung-2744-solidaritaet-kommt-zu-kurz-33410.htm\",\"display_url\":\"boeckler.de/de/magazin-mit…\",\"images\":[{\"url\":\"https://pbs.twimg.com/news_img/1410615694165561355/gLRhdQP6?format=jpg&name=orig\",\"width\":1536,\"height\":1024},{\"url\":\"https://pbs.twimg.com/news_img/1410615694165561355/gLRhdQP6?format=jpg&name=150x150\",\"width\":150,\"height\":150}],\"status\":200,\"title\":\"„Solidarität kommt zu kurz“\",\"description\":\"Mia Feldmann engagiert sich bei der GEW NRW im ­Bereich Hochschule, Forschung und Wissenschaft und arbeitet als wissenschaftliche Mit­arbeiterin an der Universität Bielefeld.\",\"unwound_url\":\"https://www.boeckler.de/de/magazin-mitbestimmung-2744-solidaritaet-kommt-zu-kurz-33410.htm\"},{\"start\":275,\"end\":298,\"url\":\"https://t.co/ho9jk5hbe7\",\"expanded_url\":\"https://twitter.com/boeckler_de/status/1403301870119141377/photo/1\",\"display_url\":\"pic.twitter.com/ho9jk5hbe7\"}],\"hashtags\":[{\"start\":3,\"end\":15,\"tag\":\"IchBinHanna\"},{\"start\":237,\"end\":249,\"tag\":\"Solidarität\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":10,\"reply_count\":2,\"like_count\":36,\"quote_count\":2},\"attachments\":{\"media_keys\":[\"3_1403295732438818823\"]},\"conversation_id\":\"1403301870119141377\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-11T10:43:32.000Z\",\"lang\":\"de\",\"author_id\":\"1116502891\"},{\"text\":\"@martin_hebart This is #IchbinHanna summary is brilliant! I’m constantly trying to explain why German #academia is a real problem—for anyone who’s not in the tiny group of professors. And people are 1st confused, then shocked, then angry. The thread is gonna help communicating what’s going on\\uD83D\\uDC4D https://t.co/aAo11EmIsf\",\"id\":\"1403623706874757122\",\"entities\":{\"urls\":[{\"start\":295,\"end\":318,\"url\":\"https://t.co/aAo11EmIsf\",\"expanded_url\":\"https://twitter.com/DannicaFleuss/status/1403623706874757122/photo/1\",\"display_url\":\"pic.twitter.com/aAo11EmIsf\"}],\"hashtags\":[{\"start\":23,\"end\":35,\"tag\":\"IchbinHanna\"},{\"start\":102,\"end\":111,\"tag\":\"academia\"}],\"mentions\":[{\"start\":0,\"end\":14,\"username\":\"martin_hebart\",\"id\":\"3318578529\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":5,\"reply_count\":1,\"like_count\":20,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"3_1403623693473943555\"]},\"conversation_id\":\"1403278141293043712\",\"source\":\"Twitter for iPhone\",\"in_reply_to_user_id\":\"3318578529\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403278141293043712\"}],\"created_at\":\"2021-06-12T08:02:24.000Z\",\"lang\":\"en\",\"author_id\":\"1380058089932664846\"},{\"text\":\"\\\"Das Wissenschaftszeitvertragsgesetz und seine Effekte als Gegenstand zeithistorischer Wissenschaftsgeschichte\\\". Die Initiator:innen von #ichbinHanna, @AmreiBahr, @DrKEichhorn\\n und @SebastianKubon, auf @zeitgeschichte.\\n@zzfpotsdam\\nhttps://t.co/uWoiPJ7iiK https://t.co/MbBolU0Srz\",\"id\":\"1403718630659985410\",\"entities\":{\"urls\":[{\"start\":231,\"end\":254,\"url\":\"https://t.co/uWoiPJ7iiK\",\"expanded_url\":\"https://zeitgeschichte-online.de/node/58477\",\"display_url\":\"zeitgeschichte-online.de/node/58477\",\"images\":[{\"url\":\"https://pbs.twimg.com/news_img/1406269303716995080/b5Etwtd3?format=png&name=orig\",\"width\":715,\"height\":484},{\"url\":\"https://pbs.twimg.com/news_img/1406269303716995080/b5Etwtd3?format=png&name=150x150\",\"width\":150,\"height\":150}],\"status\":200,\"title\":\"Forschung auf ALG 1 und Hartz IV | zeitgeschichte | online\",\"unwound_url\":\"https://zeitgeschichte-online.de/node/58477\"},{\"start\":255,\"end\":278,\"url\":\"https://t.co/MbBolU0Srz\",\"expanded_url\":\"https://twitter.com/RichterHedwig/status/1403718630659985410/photo/1\",\"display_url\":\"pic.twitter.com/MbBolU0Srz\"}],\"hashtags\":[{\"start\":137,\"end\":149,\"tag\":\"ichbinHanna\"}],\"mentions\":[{\"start\":151,\"end\":161,\"username\":\"AmreiBahr\",\"id\":\"1260870565541396480\"},{\"start\":163,\"end\":175,\"username\":\"DrKEichhorn\",\"id\":\"730098730943324162\"},{\"start\":181,\"end\":196,\"username\":\"SebastianKubon\",\"id\":\"1244061463\"},{\"start\":202,\"end\":217,\"username\":\"zeitgeschichte\",\"id\":\"150261941\"},{\"start\":219,\"end\":230,\"username\":\"zzfpotsdam\",\"id\":\"338909735\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":22,\"reply_count\":0,\"like_count\":78,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"3_1403718613480116225\"]},\"conversation_id\":\"1403718630659985410\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-12T14:19:36.000Z\",\"lang\":\"de\",\"author_id\":\"743152200281632768\"},{\"text\":\"Ich bin Frieder, 39, habilitierter Philosoph. Meine Zeit ist abgelaufen – jedenfalls laut #WissZeitVG. Mein Glück, mein Privileg in diesem irrwitzigen System ist, dass ich mich derzeit von Vertretung zu Vertretung hangeln kann. #IchbinHanna https://t.co/abyvALlTz7\",\"id\":\"1403384545496424451\",\"entities\":{\"urls\":[{\"start\":241,\"end\":264,\"url\":\"https://t.co/abyvALlTz7\",\"expanded_url\":\"https://twitter.com/F_Vogelmann/status/1403384545496424451/photo/1\",\"display_url\":\"pic.twitter.com/abyvALlTz7\"}],\"hashtags\":[{\"start\":90,\"end\":101,\"tag\":\"WissZeitVG\"},{\"start\":228,\"end\":240,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":14,\"reply_count\":2,\"like_count\":192,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"3_1403384308124078082\"]},\"conversation_id\":\"1403384545496424451\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-11T16:12:03.000Z\",\"lang\":\"de\",\"author_id\":\"1096491688657371137\"},{\"text\":\"Ich bin Max, 33 Jahre alt, Ökonom &amp; Politikwissenschaftler. Arbeite zu Demokratie &amp; Kapitalismus, Sustainable Finance + die 70er, &amp; das für mein Leben gern. Bin Postdoc im 2. Jahr WissZeitVG, hab keine Ahnung (&amp; viel Sorge) ob ich je was Unbefristetes bekommen werde. #IchBinHanna https://t.co/9UxLs9AnRx\",\"id\":\"1402956953433825283\",\"entities\":{\"urls\":[{\"start\":297,\"end\":320,\"url\":\"https://t.co/9UxLs9AnRx\",\"expanded_url\":\"https://twitter.com/maxkrahe/status/1402956953433825283/photo/1\",\"display_url\":\"pic.twitter.com/9UxLs9AnRx\"}],\"hashtags\":[{\"start\":284,\"end\":296,\"tag\":\"IchBinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":13,\"reply_count\":0,\"like_count\":241,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"3_1402953968788119555\"]},\"conversation_id\":\"1402956953433825283\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-10T11:52:58.000Z\",\"lang\":\"de\",\"author_id\":\"3033091043\"},{\"text\":\"Ich bin Alan (34). Habe 14 Jahre lang studiert und 1 Doktorarbeit über mittelalterliche Literatur geschrieben. Ich hangle mich mit Kettenverträgen+Stipendien durch, Rente was ist das? Ich habe noch 4 Jahre Zeit, bis ich nicht mehr das System verstopfe. #IchBinHanna https://t.co/eRXmu2WAxj\",\"id\":\"1402944021790658560\",\"entities\":{\"urls\":[{\"start\":266,\"end\":289,\"url\":\"https://t.co/eRXmu2WAxj\",\"expanded_url\":\"https://twitter.com/thiliel/status/1402944021790658560/photo/1\",\"display_url\":\"pic.twitter.com/eRXmu2WAxj\"}],\"hashtags\":[{\"start\":253,\"end\":265,\"tag\":\"IchBinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":10,\"reply_count\":37,\"like_count\":234,\"quote_count\":6},\"attachments\":{\"media_keys\":[\"3_1402944019123085318\"]},\"conversation_id\":\"1402944021790658560\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-10T11:01:34.000Z\",\"lang\":\"de\",\"author_id\":\"39612464\"},{\"text\":\"Ich bin Ulrich, 50, seit 13 Jahren Inhaber des Lehrstuhls für Entrepreneurship an der @UZH_ch.\\n\\n2001 promoviert wollte ich nicht #IchBinHanna werden und bin ins Ausland. Dort bin ich immer noch und wundere mich, dass es in \\uD83C\\uDDE9\\uD83C\\uDDEA in 20 Jahren null Fortschrit gegeben hat. https://t.co/v12Wfr7hZp\",\"id\":\"1402967915935186946\",\"entities\":{\"urls\":[{\"start\":268,\"end\":291,\"url\":\"https://t.co/v12Wfr7hZp\",\"expanded_url\":\"https://twitter.com/UlrichtheKaiser/status/1402967915935186946/photo/1\",\"display_url\":\"pic.twitter.com/v12Wfr7hZp\"}],\"hashtags\":[{\"start\":129,\"end\":141,\"tag\":\"IchBinHanna\"}],\"mentions\":[{\"start\":86,\"end\":93,\"username\":\"UZH_ch\",\"id\":\"384753474\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":47,\"reply_count\":9,\"like_count\":776,\"quote_count\":2},\"attachments\":{\"media_keys\":[\"3_1402967849140957190\"]},\"conversation_id\":\"1402967915935186946\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-10T12:36:31.000Z\",\"lang\":\"de\",\"author_id\":\"1069874259563036672\"},{\"text\":\"Das sind übrigens meine Verträge für HiWi-Stellen während des Studiums. Nicht das jemand sagt, das Studium bereitet einen nicht auf die Arbeitswelt in der Wissenschaft vor #IchbinHanna https://t.co/TZ7BIyXncl\",\"id\":\"1403250556840386562\",\"entities\":{\"urls\":[{\"start\":185,\"end\":208,\"url\":\"https://t.co/TZ7BIyXncl\",\"expanded_url\":\"https://twitter.com/RealCurstaedt/status/1403250556840386562/photo/1\",\"display_url\":\"pic.twitter.com/TZ7BIyXncl\"}],\"hashtags\":[{\"start\":172,\"end\":184,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":6,\"reply_count\":0,\"like_count\":94,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"3_1403250543804493828\"]},\"conversation_id\":\"1403250556840386562\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-11T07:19:38.000Z\",\"lang\":\"de\",\"author_id\":\"972273640401195009\"},{\"text\":\"Schon 2014 hat sich @WissRat zu den Karrierezielen und -wegen an Universitäten geäußert – auch zum #WissZeitVG \\uD83D\\uDC49 https://t.co/LVkoQ1koy0 #IchbinHanna @BMBF_Bund #kmk @HRK_aktuell @dfg_public @Eurodoc @NGA_Wiss @uniwind_ev @gew_bund https://t.co/9RcG7RTwSo\",\"id\":\"1403332750749356039\",\"entities\":{\"urls\":[{\"star