:255,\"url\":\"https://t.co/TIpSzPqQAO\",\"expanded_url\":\"https://twitter.com/HSchaeferIW/status/1403276771668209667/photo/1\",\"display_url\":\"pic.twitter.com/TIpSzPqQAO\"}],\"hashtags\":[{\"start\":113,\"end\":125,\"tag\":\"ichbinhanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":9,\"reply_count\":13,\"like_count\":21,\"quote_count\":3},\"attachments\":{\"media_keys\":[\"3_1403276028391329799\"]},\"conversation_id\":\"1403276771668209667\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-11T09:03:48.000Z\",\"lang\":\"de\",\"author_id\":\"2151032010\"},{\"text\":\"Kann bitte jemand mal alle Wikipediaseiten dt. Soziolog*innen umschreiben in sowas in der Art? (beliebig rausgegriffen, hier mal Dahrendorf) #ichbinhanna https://t.co/oKkzrXz21c\",\"id\":\"1403072980842954755\",\"entities\":{\"urls\":[{\"start\":154,\"end\":177,\"url\":\"https://t.co/oKkzrXz21c\",\"expanded_url\":\"https://twitter.com/techsoz/status/1403072980842954755/photo/1\",\"display_url\":\"pic.twitter.com/oKkzrXz21c\"}],\"hashtags\":[{\"start\":141,\"end\":153,\"tag\":\"ichbinhanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":10,\"reply_count\":1,\"like_count\":44,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"3_1403072929697517571\"]},\"conversation_id\":\"1403072980842954755\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-10T19:34:01.000Z\",\"lang\":\"de\",\"author_id\":\"28532853\"},{\"text\":\"Ich bin Alina, 27. Bis 2050 könnten antibiotika-resistente Keime zur weltweit häufigsten Todesursache werden. Ich forsche im Rahmen meiner Promotion zu Antibiotika-produzieren Bakterien -&gt; für neue Antibiotika. \\n2 Jahre steht die Finanzierung, danach ALG I? \\n#IchBinHanna https://t.co/H9jJZY6Ky0\",\"id\":\"1403042712232755205\",\"entities\":{\"urls\":[{\"start\":275,\"end\":298,\"url\":\"https://t.co/H9jJZY6Ky0\",\"expanded_url\":\"https://twitter.com/alinchik2z/status/1403042712232755205/photo/1\",\"display_url\":\"pic.twitter.com/H9jJZY6Ky0\"}],\"hashtags\":[{\"start\":262,\"end\":274,\"tag\":\"IchBinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":204,\"reply_count\":44,\"like_count\":2210,\"quote_count\":11},\"attachments\":{\"media_keys\":[\"3_1403042708554489861\"]},\"conversation_id\":\"1403042712232755205\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-10T17:33:44.000Z\",\"lang\":\"de\",\"author_id\":\"1305809637690806272\"},{\"text\":\"Mensch, Mädels, hört auf zu jammern, warum der Steuerzahler nicht noch mehr für Euch tut, als er bisher schon geleistet hat. Heiratet, erzieht Kinder, sonst ist in dreißig Jahren eh niemand mehr da, der die fetten Beamtenpensionen erwirtschaftet, die Ihr gern hättet. #IchbinHanna https://t.co/qmkb4EdtuS\",\"id\":\"1403040872145489922\",\"entities\":{\"urls\":[{\"start\":281,\"end\":304,\"url\":\"https://t.co/qmkb4EdtuS\",\"expanded_url\":\"https://twitter.com/Ruebenhorst/status/1403040872145489922/video/1\",\"display_url\":\"pic.twitter.com/qmkb4EdtuS\"}],\"hashtags\":[{\"start\":268,\"end\":280,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":39,\"reply_count\":11,\"like_count\":267,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"7_1403040762149888002\"]},\"conversation_id\":\"1403040872145489922\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-10T17:26:25.000Z\",\"lang\":\"de\",\"author_id\":\"970421608362934272\"},{\"text\":\"Ich bin Anne-Sophie, #Bildungspsychologin und arbeite seit Sep 2016 in verschiedenen #Drittmittelprojekten &amp; habe mich zwischenzeitlich mit einem #Stipendium finanziert. /1\\n\\n#IchBinHanna #IchWarHanna https://t.co/BfyDmJoLB0 https://t.co/DkFXWWOpsD\",\"id\":\"1403018197985529861\",\"entities\":{\"urls\":[{\"start\":204,\"end\":227,\"url\":\"https://t.co/BfyDmJoLB0\",\"expanded_url\":\"https://twitter.com/ansophiliert/status/1403018197985529861/photo/1\",\"display_url\":\"pic.twitter.com/BfyDmJoLB0\"},{\"star