936197/photo/1\",\"display_url\":\"pic.twitter.com/Cip34Jv7ly\"}],\"hashtags\":[{\"start\":36,\"end\":48,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":7,\"reply_count\":2,\"like_count\":126,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"3_1403076243315216384\"]},\"conversation_id\":\"1403076266492936197\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-10T19:47:04.000Z\",\"lang\":\"de\",\"author_id\":\"1067793727089983489\"},{\"text\":\"@FrauTasia @jurabilis Uff. Das tut mir leid. Absolut beschissen. Harmloser kann man das nicht beschreiben. Respekt, dass Du das so durchziehen konntest!\",\"id\":\"1403676404131282945\",\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":0,\"reply_count\":2,\"like_count\":1,\"quote_count\":0},\"conversation_id\":\"1403605695056994306\",\"source\":\"Twitter for iPhone\",\"in_reply_to_user_id\":\"3048143637\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403672583774650371\"}],\"created_at\":\"2021-06-12T11:31:48.000Z\",\"entities\":{\"mentions\":[{\"start\":0,\"end\":10,\"username\":\"FrauTasia\",\"id\":\"3048143637\"},{\"start\":11,\"end\":21,\"username\":\"jurabilis\",\"id\":\"22682375\"}]},\"lang\":\"de\",\"author_id\":\"21561570\"},{\"text\":\"Ich bin Mia, wollte ab Oktober promovieren, sitze seit 2h im Garten, lese jeden einzelnen Tweet unter #IchBinHanna und weine mir aufgrund so vieler prekärer Einzelschicksale gerade die Augen aus.\\n#acertaindegreeofflexibility https://t.co/Kl3oPkJijj\",\"id\":\"1403069749492334596\",\"entities\":{\"urls\":[{\"start\":225,\"end\":248,\"url\":\"https://t.co/Kl3oPkJijj\",\"expanded_url\":\"https://twitter.com/miaalein1/status/1403069749492334596/photo/1\",\"display_url\":\"pic.twitter.com/Kl3oPkJijj\"}],\"hashtags\":[{\"start\":102,\"end\":114,\"tag\":\"IchBinHanna\"},{\"start\":196,\"end\":224,\"tag\":\"acertaindegreeofflexibility\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":13,\"reply_count\":14,\"like_count\":342,\"quote_count\":5},\"attachments\":{\"media_keys\":[\"3_1403069717158502401\"]},\"conversation_id\":\"1403069749492334596\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-10T19:21:10.000Z\",\"lang\":\"de\",\"author_id\":\"1333878004221693953\"},{\"text\":\"Ich bin Antonia. 2018 hat mich das #WissZeitVG dazu gebracht, ins Ausland zu gehen. Das war für mich ein Glücksfall, denn noch nie war ich so produktiv wie seit dem Zeitpunkt, an dem mir eine Institution einen unbefristeten Vertrag gegeben hat #IchbinHanna https://t.co/E1TxouX62E\",\"id\":\"1402960630970257410\",\"entities\":{\"urls\":[{\"start\":257,\"end\":280,\"url\":\"https://t.co/E1TxouX62E\",\"expanded_url\":\"https://twitter.com/ant_scholkmann/status/1402960630970257410/photo/1\",\"display_url\":\"pic.twitter.com/E1TxouX62E\"}],\"hashtags\":[{\"start\":35,\"end\":46,\"tag\":\"WissZeitVG\"},{\"start\":244,\"end\":256,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":51,\"reply_count\":3,\"like_count\":719,\"quote_count\":2},\"attachments\":{\"media_keys\":[\"3_1402959732806230016\"]},\"conversation_id\":\"1402960630970257410\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-10T12:07:34.000Z\",\"lang\":\"de\",\"author_id\":\"4029777196\"},{\"text\":\"Bester Take bisher #ichbinHanna https://t.co/yAY6DisdIB\",\"id\":\"1403608963590115328\",\"entities\":{\"urls\":[{\"start\":32,\"end\":55,\"url\":\"https://t.co/yAY6DisdIB\",\"expanded_url\":\"https://twitter.com/StrickSimon/status/1403608963590115328/photo/1\",\"display_url\":\"pic.twitter.com/yAY6DisdIB\"}],\"hashtags\":[{\"start\":19,\"end\":31,\"tag\":\"ichbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":1,\"reply_count\":0,\"like_count\":7,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"3_1403608957294350337\"]},\"conversation_id\":\"1403608963590115328\",\"source\":\"Twitter for iPad\",\"created_at\":\"2021-06-12T07:03:49.000Z\",\"lang\":\"en\",\"author_id\":\"1244531588928606210\"},{\"text\":\"Ich bin Karoline, 38, Historikerin. Meine  Themen sind Mittelalter, #OpenAccess, #DigitalHumanities, Forschungs-&amp;Publikationsinfrastrukturen. Ich bin zum 10. Mal befristet angestellt &amp; hab keine Lust mehr auf #ACertainDegreeOfFlexibility\\n\\n#IchBinHanna aber ich wäre lieber Lars. https://t.co/Ck5gdTNQI1\",\"id\":\"1402929338681413634\",\"entities\":{\"urls\":[{\"start\":287,\"end\":310,\"url\":\"https://t.co/Ck5gdTNQI1\",\"expanded_url\":\"https://twitter.com/karolinedoering/status/1402929338681413634/photo/1\",\"display_url\":\"pic.twitter.com/Ck5gdTNQI1\"}],\"hashtags\":[{\"start\":68,\"end\":79,\"tag\":\"OpenAccess\"},{\"start\":81,\"end\":99,\"tag\":\"DigitalHumanities\"},{\"start\":217,\"end\":245,\"tag\":\"ACertainDegreeOfFlexibility\"},{\"start\":247,\"end\":259,\"tag\":\"IchBinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":132,\"reply_count\":27,\"like_count\":1320,\"quote_count\":4},\"attachments\":{\"media_keys\":[\"3_1402929335158325251\"]},\"conversation_id\":\"1402929338681413634\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-10T10:03:14.000Z\",\"lang\":\"de\",\"author_id\":\"1062831254\"},{\"text\":\"#PhD life in academia. #IchbinHanna \\n#AcademicTwitter #AcademicChatter #phdvoice #openAcademics \\n\\uD835\\uDDF5\\uD835\\uDDFC\\uD835\\uDE04 \\uD835\\uDDF6\\uD835\\uDE01 \\uD835\\uDE00\\uD835\\uDE01\\uD835\\uDDEE\\uD835\\uDDFF\\uD835\\uDE01\\uD835\\uDDF2\\uD835\\uDDF1             \\uD835\\uDDF5\\uD835\\uDDFC\\uD835\\uDE04 \\uD835\\uDDF6\\uD835\\uDE01‘\\uD835\\uDE00 \\uD835\\uDDF4\\uD835\\uDDFC\\uD835\\uDDF6\\uD835\\uDDFB\\uD835\\uDDF4 https://t.co/CDCBQHlq9a\",\"id\":\"1403599693469388804\",\"entities\":{\"urls\":[{\"start\":139,\"end\":162,\"url\":\"https://t.co/CDCBQHlq9a\",\"expanded_url\":\"https://twitter.com/SchallmoserA/status/1403599693469388804/photo/1\",\"display_url\":\"pic.twitter.com/CDCBQHlq9a\"},{\"start\":139,\"end\":162,\"url\":\"https://t.co/CDCBQHlq9a\",\"expanded_url\":\"https://twitter.com/SchallmoserA/status/1403599693469388804/photo/1\",\"display_url\":\"pic.twitter.com/CDCBQHlq9a\"}],\"hashtags\":[{\"start\":0,\"end\":4,\"tag\":\"PhD\"},{\"start\":23,\"end\":35,\"tag\":\"IchbinHanna\"},{\"start\":37,\"end\":53,\"tag\":\"AcademicTwitter\"},{\"start\":54,\"end\":70,\"tag\":\"AcademicChatter\"},{\"start\":71,\"end\":80,\"tag\":\"phdvoice\"},{\"start\":81,\"end\":95,\"tag\":\"openAcademics\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":4,\"reply_count\":0,\"like_count\":24,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"3_1403599688029413377\",\"3_1403599688004259842\"]},\"conversation_id\":\"1403599693469388804\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-12T06:26:59.000Z\",\"lang\":\"en\",\"author_id\":\"967482529170313216\"},{\"text\":\"Ok, since #IchbinHanna is trending, for everyone who doesn't know the German academic system and how messed up it is because of its weird laws and rules, here's a short version. 1/n\",\"id\":\"1403278141293043712\",\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":655,\"reply_count\":25,\"like_count\":1776,\"quote_count\":151},\"conversation_id\":\"1403278141293043712\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":10,\"end\":22,\"tag\":\"IchbinHanna\"}]},\"created_at\":\"2021-06-11T09:09:15.000Z\",\"lang\":\"en\",\"author_id\":\"3318578529\"},{\"text\":\"Ich bin Constanze, 27. Vor zwei Jahren wurde ich als chronisch krank diagnostiziert, sechs Wochen später habe ich mich trotzdem auf eine Promotion beworben. Ich halte mich für eine der Glücklichen, die ein Stipendium für 3 Jahre bekommen. #IchbinHanna #acertaindegreeofflexibility https://t.co/x1PYPFsWTJ\",\"id\":\"1403263020302749696\",\"entities\":{\"urls\":[{\"start\":281,\"end\":304,\"url\":\"https://t.co/x1PYPFsWTJ\",\"expanded_url\":\"https://twitter.com/diejungedame/status/1403263020302749696/photo/1\",\"display_url\":\"pic.twitter.com/x1PYPFsWTJ\"}],\"hashtags\":[{\"start\":239,\"end\":251,\"tag\":\"IchbinHanna\"},{\"start\":252,\"end\":280,\"tag\":\"acertaindegreeofflexibility\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":5,\"reply_count\":1,\"like_count\":36,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"3_1403263015533826052\"]},\"conversation_id\":\"1403263020302749696\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-11T08:09:10.000Z\",\"lang\":\"de\",\"author_id\":\"379644155\"},{\"text\":\"Da ich nie viele Jahre in die Zukunft plane, sind Zeitverträge sicherlich nicht der Hauptgrund für das Stocken meiner akademischen Karriere.\\n\\nAber die Voraussicht, später evtl. mehrmals kurzfristig umziehen zu müssen, hat meine Motivation sicher nicht gesteigert. #IchBinHanna https://t.co/Xa0ilx9qrq\",\"id\":\"1402990404690079751\",\"entities\":{\"urls\":[{\"start\":277,\"end\":300,\"url\":\"https://t.co/Xa0ilx9qrq\",\"expanded_url\":\"https://twitter.com/Melktim/status/1402990404690079751/photo/1\",\"display_url\":\"pic.twitter.com/Xa0ilx9qrq\"}],\"hashtags\":[{\"start\":264,\"end\":276,\"tag\":\"IchBinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":32,\"reply_count\":4,\"like_count\":475,\"quote_count\":4},\"attachments\":{\"media_keys\":[\"3_1402990100175212549\"]},\"conversation_id\":\"1402990404690079751\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-10T14:05:53.000Z\",\"lang\":\"de\",\"author_id\":\"1162714807776284673\"},{\"text\":\"Lorenz, 32, Systembiologe, Erstakademiker, summa cum laude promoviert, Postdoc am @WeizmannScience, demnächst PI am @UKEHamburg, seit elf Jahren Mentor, 548 Zitate, zwei Patente, aber klar, für tenure reicht das nicht... #IchBinHanna https://t.co/OuqukKxtcH\",\"id\":\"1402957622207188995\",\"entities\":{\"urls\":[{\"start\":234,\"end\":257,\"url\":\"https://t.co/OuqukKxtcH\",\"expanded_url\":\"https://twitter.com/LorenzAdlung/status/1402957622207188995/photo/1\",\"display_url\":\"pic.twitter.com/OuqukKxtcH\"}],\"hashtags\":[{\"start\":221,\"end\":233,\"tag\":\"IchBinHanna\"}],\"mentions\":[{\"start\":82,\"end\":98,\"username\":\"WeizmannScience\",\"id\":\"39958512\"},{\"start\":116,\"end\":127,\"username\":\"UKEHamburg\",\"id\":\"1087283602050682880\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":39,\"reply_count\":8,\"like_count\":639,\"quote_count\":2},\"attachments\":{\"media_keys\":[\"3_1402957619019538435\"]},\"conversation_id\":\"1402957622207188995\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-10T11:55:37.000Z\",\"lang\":\"de\",\"author_id\":\"1623124639\"},{\"text\":\"Ich bin Marcel, 39, Politikwissenschaftler, promoviert, habilitiert. Ich forsche zur Stabilität von Demokratien und den Auswirkungen des Populismus. Ich habe über 12 Jahre Erfahrung in der universitären Lehre. Das BMBF ist froh, wenn es mich los ist. #IchbinHanna https://t.co/6RqHvJoKNr\",\"id\":\"1402950045582909443\",\"entities\":{\"urls\":[{\"start\":264,\"end\":287,\"url\":\"https://t.co/6RqHvJoKNr\",\"expanded_url\":\"https://twitter.com/mlewandowsky/status/1402950045582909443/photo/1\",\"display_url\":\"pic.twitter.com/6RqHvJoKNr\"}],\"hashtags\":[{\"start\":251,\"end\":263,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":103,\"reply_count\":70,\"like_count\":1625,\"quote_count\":13},\"attachments\":{\"media_keys\":[\"3_1402950030160433157\"]},\"conversation_id\":\"1402950045582909443\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-10T11:25:31.000Z\",\"lang\":\"de\",\"author_id\":\"19967836\"},{\"text\":\"Puh, was manche eine schon zu \\\"Mittelalter\\\" beleidigen. Aber wenn ich sehe, wie die DruKos bei den Kolleg*innen aus den #GenderStudies abgehen, hätte ich bei mir Mittelalter &amp; Gender schreiben sollen und damit Twitter einfach abgebrannt \\uD83E\\uDD2D #IchBinHanna https://t.co/s5wqaArCsO\",\"id\":\"1403306190390677509\",\"entities\":{\"urls\":[{\"start\":256,\"end\":279,\"url\":\"https://t.co/s5wqaArCsO\",\"expanded_url\":\"https://twitter.com/karolinedoering/status/1403306190390677509/photo/1\",\"display_url\":\"pic.twitter.com/s5wqaArCsO\"}],\"hashtags\":[{\"start\":120,\"end\":134,\"tag\":\"GenderStudies\"},{\"start\":243,\"end\":255,\"tag\":\"IchBinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":4,\"reply_count\":0,\"like_count\":27,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"16_1403306181288923137\"]},\"conversation_id\":\"1403306190390677509\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-11T11:00:42.000Z\",\"lang\":\"de\",\"author_id\":\"1062831254\"},{\"text\":\"Hallo, ich bin Annika, Doktorandin in Soziologie &amp; Gender Studies. Ich liebe Lehre &amp; Forschung und würde gerne in der Wissenschaft bleiben. Die Unsicherheit, jemals einen unbefristeten Vertrag zu bekommen bedeutet Stress, schlechtere Lehre &amp; unmögliche Lebensplanung \\n#IchBinHanna https://t.co/uL6dA5vD8O\",\"id\":\"1403006827944632322\",\"entities\":{\"urls\":[{\"start\":293,\"end\":316,\"url\":\"https://t.co/uL6dA5vD8O\",\"expanded_url\":\"https://twitter.com/AnnikaSpahn/status/1403006827944632322/photo/1\",\"display_url\":\"pic.twitter.com/uL6dA5vD8O\"}],\"hashtags\":[{\"start\":280,\"end\":292,\"tag\":\"IchBinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":92,\"reply_count\":89,\"like_count\":1512,\"quote_count\":17},\"attachments\":{\"media_keys\":[\"3_1403006124534677508\"]},\"conversation_id\":\"1403006827944632322\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-10T15:11:09.000Z\",\"lang\":\"de\",\"author_id\":\"558935792\"},{\"text\":\"Ich bin Joana, 33, Literaturwissenschaftlerin. Und ich habe noch 4 Jahre, 5 Monate und 21 Tage Zeit, das System mit Forschung über Tagebücher, die Kleine Eiszeit und Editionen zu verstopfen (mit spätem Feierabend und Wochenendarbeit). #IchbinHanna https://t.co/DnoUTjhjN2\",\"id\":\"1402963408396468225\",\"entities\":{\"urls\":[{\"start\":248,\"end\":271,\"url\":\"https://t.co/DnoUTjhjN2\",\"expanded_url\":\"https://twitter.com/van_de_light/status/1402963408396468225/photo/1\",\"display_url\":\"pic.twitter.com/DnoUTjhjN2\"}],\"hashtags\":[{\"start\":235,\"end\":247,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":13,\"reply_count\":9,\"like_count\":259,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"3_1402963405468844041\"]},\"conversation_id\":\"1402963408396468225\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-10T12:18:37.000Z\",\"lang\":\"de\",\"author_id\":\"947448543677222913\"},{\"text\":\"#IchBinHanna als Reaktion auf ein @BMBF_Bund Erklärvideo hat Wellen geschlagen; @AmreiBahr, @SebastianKubon &amp; @DrKEichhorn über das #WissZeitVG und seine Effekte als Gegenstand zeithistorischer Wissenschaftsgeschichte:\\n\\\"Forschung auf ALG 1 und Hartz IV\\\"\\n\\n➡️https://t.co/KgufyUQCDj https://t.co/icFR5u38WB\",\"id\":\"1403249141690548227\",\"entities\":{\"urls\":[{\"start\":261,\"end\":284,\"url\":\"https://t.co/KgufyUQCDj\",\"expanded_url\":\"http://bitly.ws/e8Pj\",\"display_url\":\"bitly.ws/e8Pj\"},{\"start\":285,\"end\":308,\"url\":\"https://t.co/icFR5u38WB\",\"expanded_url\":\"https://twitter.com/zeitgeschichte/status/1403249141690548227/photo/1\",\"display_url\":\"pic.twitter.com/icFR5u38WB\"}],\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchBinHanna\"},{\"start\":136,\"end\":147,\"tag\":\"WissZeitVG\"}],\"mentions\":[{\"start\":34,\"end\":44,\"username\":\"BMBF_Bund\",\"id\":\"2969727718\"},{\"start\":80,\"end\":90,\"username\":\"AmreiBahr\",\"id\":\"1260870565541396480\"},{\"start\":92,\"end\":107,\"username\":\"SebastianKubon\",\"id\":\"1244061463\"},{\"start\":114,\"end\":126,\"username\":\"DrKEichhorn\",\"id\":\"730098730943324162\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":52,\"reply_count\":2,\"like_count\":110,\"quote_count\":3},\"attachments\":{\"media_keys\":[\"3_1403248918268465156\"]},\"conversation_id\":\"1403249141690548227\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-11T07:14:01.000Z\",\"lang\":\"de\",\"author_id\":\"150261941\"},{\"text\":\"Ich bin Amrei, 35 Jahre alt, Philosophin. Meine Forschungsthemen: Kopierethik, Ethik des Recyclings &amp; Publikationsethik. #WissKomm mache ich gern, auch in der Lehre. Gremienarbeit ist mir wichtig. Ich mag Interdisziplinarität &amp; gemeinsames Nachdenken. Wer seid Ihr? #IchBinHanna https://t.co/Yuzyj4wtX3 https://t.co/pJUraGuUVy\",\"id\":\"1402894775452319747\",\"entities\":{\"urls\":[{\"start\":287,\"end\":310,\"url\":\"https://t.co/Yuzyj4wtX3\",\"expanded_url\":\"https://twitter.com/AmreiBahr/status/1402894775452319747/photo/1\",\"display_url\":\"pic.twitter.com/Yuzyj4wtX3\"},{\"start\":311,\"end\":334,\"url\":\"https://t.co/pJUraGuUVy\",\"expanded_url\":\"https://twitter.com/SebastianKubon/status/1402886172158873600\",\"display_url\":\"twitter.com/SebastianKubon…\"}],\"hashtags\":[{\"start\":125,\"end\":134,\"tag\":\"WissKomm\"},{\"start\":274,\"end\":286,\"tag\":\"IchBinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":53,\"reply_count\":15,\"like_count\":581,\"quote_count\":25},\"attachments\":{\"media_keys\":[\"3_1402894768871518208\"]},\"conversation_id\":\"1402894775452319747\",\"source\":\"Twitter for iPhone\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1402886172158873600\"}],\"created_at\":\"2021-06-10T07:45:53.000Z\",\"lang\":\"de\",\"author_id\":\"1260870565541396480\"},{\"text\":\"@svengesser @LenaOetzel Drittmittel und Promotionen befeuern den Befristungshype, denn die betr. Kennzahlen dienen als Ausweis von \\\"Qualität\\\": des/der Einzelnen, des Instituts, der Fakultät usw. Der Druck kommt von Uni, Politik, Öffentlichkeit, ist aber auch längst internalisiert. #IchbinHanna\",\"id\":\"1403447547058868224\",\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":8,\"reply_count\":0,\"like_count\":40,\"quote_count\":1},\"conversation_id\":\"1403432003123433475\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"891014603097952256\",\"entities\":{\"hashtags\":[{\"start\":282,\"end\":294,\"tag\":\"IchbinHanna\"}],\"mentions\":[{\"start\":0,\"end\":11,\"username\":\"svengesser\",\"id\":\"891014603097952256\"},{\"start\":12,\"end\":23,\"username\":\"LenaOetzel\",\"id\":\"978975816775340033\"}]},\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403432003123433475\"}],\"created_at\":\"2021-06-11T20:22:24.000Z\",\"lang\":\"de\",\"author_id\":\"1192397801008881664\"},{\"text\":\"Bitte, RETWEET, hilf mir, diese Poster zu teilen. #DenisePipitone könnte überall sein. Wenn Sie sie erkennen, sagen Sie uns bitte, wo sie ist (Belohnung: $ 50.000) \\uD83D\\uDE4F\\n\\n#Euro2021 Elden Ring #IchbinHanna Forschung U-Bahn Wissenschaft Peter Klimaschutz Baerbock Ziele Preise Dressen https://t.co/MLIxFL6GKg\",\"id\":\"1403276991764307968\",\"entities\":{\"urls\":[{\"start\":279,\"end\":302,\"url\":\"https://t.co/MLIxFL6GKg\",\"expanded_url\":\"https://twitter.com/Giovann64476517/status/1403276991764307968/photo/1\",\"display_url\":\"pic.twitter.com/MLIxFL6GKg\"},{\"start\":279,\"end\":302,\"url\":\"https://t.co/MLIxFL6GKg\",\"expanded_url\":\"https://twitter.com/Giovann64476517/status/1403276991764307968/photo/1\",\"display_url\":\"pic.twitter.com/MLIxFL6GKg\"}],\"hashtags\":[{\"start\":50,\"end\":65,\"tag\":\"DenisePipitone\"},{\"start\":167,\"end\":176,\"tag\":\"Euro2021\"},{\"start\":188,\"end\":200,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":6,\"reply_count\":0,\"like_count\":4,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"3_1403276975427497989\",\"3_1403276983392407558\"]},\"conversation_id\":\"1403276991764307968\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-11T09:04:41.000Z\",\"lang\":\"de\",\"author_id\":\"1380545687163703296\"},{\"text\":\"Benjamin, 36, politische Ökonomie. Hatte viel Glück: Seit 2014 am Max Planck Institut; dazwischen Harvard und IAS Princeton; dabei eine amerikanische Partnerin gefunden, die nun mit und wegen mir hier lebt, Deutsch lernt. Wir erwarten 2024 und das \\\"So long\\\" der MPG. #IchbinHanna https://t.co/QYhUiajjxm\",\"id\":\"1403318362671923201\",\"entities\":{\"urls\":[{\"start\":280,\"end\":303,\"url\":\"https://t.co/QYhUiajjxm\",\"expanded_url\":\"https://twitter.com/BJMbraun/status/1403318362671923201/photo/1\",\"display_url\":\"pic.twitter.com/QYhUiajjxm\"}],\"hashtags\":[{\"start\":267,\"end\":279,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":3,\"reply_count\":1,\"like_count\":85,\"quote_count\":2},\"attachments\":{\"media_keys\":[\"3_1403317352578572291\"]},\"conversation_id\":\"1403318362671923201\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-11T11:49:04.000Z\",\"lang\":\"de\",\"author_id\":\"3580686315\"},{\"text\":\"#IchBinHanna trendet! Ich bin Andreas, 55, Delegierter Nr. 007 auf dem @gew_bund-Gewerkschaftstag #GEWTAG21, der soeben meine Lizenz zum #Entfristen von #Zeitverträge|n in der #Wissenschaft verlängert hat. Mach mit beim Kampf für #Dauerstellen! https://t.co/Lnfzzwa3qf @BMBF_Bund https://t.co/ph6y4gGH1c\",\"id\":\"1403283369664860161\",\"entities\":{\"urls\":[{\"start\":245,\"end\":268,\"url\":\"https://t.co/Lnfzzwa3qf\",\"expanded_url\":\"http://www.gew.de/dauerstellen\",\"display_url\":\"gew.de/dauerstellen\",\"images\":[{\"url\":\"https://pbs.twimg.com/news_img/1410258300604760070/5nyKpR1S?format=png&name=orig\",\"width\":750,\"height\":422},{\"url\":\"https://pbs.twimg.com/news_img/1410258300604760070/5nyKpR1S?format=png&name=150x150\",\"width\":150,\"height\":150}],\"status\":200,\"title\":\"Dauerstellen für Daueraufgaben : GEW - Die Bildungsgewerkschaft\",\"description\":\"In der Wissenschaft gibt es Probleme: Immer mehr Zeitverträge mit immer kürzeren Laufzeiten, lange und steinige Karrierewege. Mit der Kampagne „Dauerstellen für Daueraufgaben“ kämpft die GEW für mehr Dauerstellen an den Hochschulen.\",\"unwound_url\":\"https://www.gew.de/dauerstellen/\"},{\"start\":280,\"end\":303,\"url\":\"https://t.co/ph6y4gGH1c\",\"expanded_url\":\"https://twitter.com/AKellerGEW/status/1403283369664860161/photo/1\",\"display_url\":\"pic.twitter.com/ph6y4gGH1c\"}],\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchBinHanna\"},{\"start\":98,\"end\":107,\"tag\":\"GEWTAG21\"},{\"start\":137,\"end\":148,\"tag\":\"Entfristen\"},{\"start\":153,\"end\":166,\"tag\":\"Zeitverträge\"},{\"start\":176,\"end\":189,\"tag\":\"Wissenschaft\"},{\"start\":230,\"end\":243,\"tag\":\"Dauerstellen\"}],\"mentions\":[{\"start\":71,\"end\":80,\"username\":\"gew_bund\",\"id\":\"773896429\"},{\"start\":269,\"end\":279,\"username\":\"BMBF_Bund\",\"id\":\"2969727718\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":12,\"reply_count\":0,\"like_count\":53,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"3_1403281917026476032\"]},\"conversation_id\":\"1403283369664860161\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-11T09:30:01.000Z\",\"lang\":\"de\",\"author_id\":\"284725708\"},{\"text\":\"Übrigens wurde schon 1984 die zunehmende Perspektivlosigkeit von Nachwuchsforscher*innen in der damaligen BRD kritisiert, wie hier in der Vorbemerkung zu Jürgen Schuttes Einführungsband in die Literaturinterpretation. 1984. #IchBinHanna https://t.co/NhiiUIfqY3\",\"id\":\"1403440841541263365\",\"entities\":{\"urls\":[{\"start\":237,\"end\":260,\"url\":\"https://t.co/NhiiUIfqY3\",\"expanded_url\":\"https://twitter.com/DonickMario/status/1403440841541263365/photo/1\",\"display_url\":\"pic.twitter.com/NhiiUIfqY3\"}],\"hashtags\":[{\"start\":224,\"end\":236,\"tag\":\"IchBinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":1,\"reply_count\":1,\"like_count\":4,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"3_1403440833748258821\"]},\"conversation_id\":\"1403440841541263365\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-11T19:55:45.000Z\",\"lang\":\"de\",\"author_id\":\"1352980323521470467\"},{\"text\":\"Ich bin Jakob. Ich habe Physik in Dresden, Leipzig und Paris studiert, in synthetischer Biologie promoviert und als Postdoc in Oxford geforscht, seit 2014 wissenschaftlicher Koordinator für die @MaxPlanckPress. Seit 2005 befristet. Ich bin 44. #IchBinHanna Wer bist du? @BMBF_Bund https://t.co/65t2q47f10 https://t.co/O5HkkTYYTH\",\"id\":\"1403109737302986760\",\"entities\":{\"urls\":[{\"start\":281,\"end\":304,\"url\":\"https://t.co/65t2q47f10\",\"expanded_url\":\"https://twitter.com/Jakob_Schweizer/status/1403109737302986760/photo/1\",\"display_url\":\"pic.twitter.com/65t2q47f10\"},{\"start\":305,\"end\":328,\"url\":\"https://t.co/O5HkkTYYTH\",\"expanded_url\":\"https://twitter.com/DegnerAnja/status/1402944618233217027\",\"display_url\":\"twitter.com/DegnerAnja/sta…\"}],\"hashtags\":[{\"start\":244,\"end\":256,\"tag\":\"IchBinHanna\"}],\"mentions\":[{\"start\":194,\"end\":209,\"username\":\"maxplanckpress\",\"id\":\"205195655\"},{\"start\":270,\"end\":280,\"username\":\"BMBF_Bund\",\"id\":\"2969727718\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":25,\"reply_count\":2,\"like_count\":132,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"3_1403109124712374278\"]},\"conversation_id\":\"1403109737302986760\",\"source\":\"Twitter Web App\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1402944618233217027\"}],\"created_at\":\"2021-06-10T22:00:04.000Z\",\"lang\":\"de\",\"author_id\":\"1131866661592719365\"},{\"text\":\"Bei #IchbinHanna musste ich an folgende Stelle in Max Webers \\\"Wissenschaft als Beruf\\\" denken. Das deutsche Wissenschaftssystem war wohl bereits 1917 ein \\\"wilder Hazard\\\" für early career researcher. Das #WissZeitVG hat die Sache sicherlich nicht besser gemacht https://t.co/CufOoefSJh\",\"id\":\"1403345176999993344\",\"entities\":{\"urls\":[{\"start\":260,\"end\":283,\"url\":\"https://t.co/CufOoefSJh\",\"expanded_url\":\"https://twitter.com/cczymara/status/1403345176999993344/photo/1\",\"display_url\":\"pic.twitter.com/CufOoefSJh\"}],\"hashtags\":[{\"start\":4,\"end\":16,\"tag\":\"IchbinHanna\"},{\"start\":202,\"end\":213,\"tag\":\"WissZeitVG\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":3,\"reply_count\":1,\"like_count\":21,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"3_1403339984229306369\"]},\"conversation_id\":\"1403345176999993344\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-11T13:35:37.000Z\",\"lang\":\"de\",\"author_id\":\"1165967017771487233\"},{\"text\":\"Ich bin Steffen. Mikrobiologe.\\nNach Promotion Ende 1996 befristete Stellen, am Ende monatlich. Mit 1. Kind. \\n2001 dann Industrie #Berlin #qualitätskontrolle #pharma, cooler Job aber Karrieredruck.\\nBewerbung #HAW-Professur, 2009 Start. Sehr glücklich mit #Lehre \\n#IchBinHanna https://t.co/CBg7fM2shg\",\"id\":\"1403076988814888968\",\"entities\":{\"urls\":[{\"start\":275,\"end\":298,\"url\":\"https://t.co/CBg7fM2shg\",\"expanded_url\":\"https://twitter.com/StePMikrobe/status/1403076988814888968/photo/1\",\"display_url\":\"pic.twitter.com/CBg7fM2shg\"}],\"hashtags\":[{\"start\":129,\"end\":136,\"tag\":\"Berlin\"},{\"start\":137,\"end\":156,\"tag\":\"qualitätskontrolle\"},{\"start\":157,\"end\":164,\"tag\":\"pharma\"},{\"start\":207,\"end\":211,\"tag\":\"HAW\"},{\"start\":254,\"end\":260,\"tag\":\"Lehre\"},{\"start\":262,\"end\":274,\"tag\":\"IchBinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":2,\"reply_count\":0,\"like_count\":15,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"3_1403076979470000132\"]},\"conversation_id\":\"1403076988814888968\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-10T19:49:56.000Z\",\"lang\":\"de\",\"author_id\":\"4878027389\"},{\"text\":\".Sklaverei und sons...\\n#IchbinHanna https://t.co/Eq5SbFTO83\",\"id\":\"1403262143194095620\",\"entities\":{\"urls\":[{\"start\":36,\"end\":59,\"url\":\"https://t.co/Eq5SbFTO83\",\"expanded_url\":\"https://twitter.com/wernerwelge1/status/1403262143194095620/photo/1\",\"display_url\":\"pic.twitter.com/Eq5SbFTO83\"}],\"hashtags\":[{\"start\":23,\"end\":35,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":1,\"reply_count\":0,\"like_count\":2,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"16_1403262129399021569\"]},\"conversation_id\":\"1403262143194095620\",\"source\":\"Twitter for Android\",\"created_at\":\"2021-06-11T08:05:40.000Z\",\"lang\":\"de\",\"author_id\":\"1857015020\"},{\"text\":\"\\uD83E\\uDD1E\\uD83D\\uDE2C\",\"id\":\"1402898824465719297\",\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":6,\"quote_count\":0},\"conversation_id\":\"1402898821881942016\",\"source\":\"Twitter for Mac\",\"in_reply_to_user_id\":\"550366123\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1402898823178067969\"}],\"created_at\":\"2021-06-10T08:01:59.000Z\",\"lang\":\"und\",\"author_id\":\"550366123\"},{\"text\":\"@SebastianKubon #IchbinHanna trendet sogar auf LinkedIn ;) Weiter so \\uD83D\\uDC4D https://t.co/1E8ID3sc4F\",\"id\":\"1403391165739810816\",\"entities\":{\"urls\":[{\"start\":71,\"end\":94,\"url\":\"https://t.co/1E8ID3sc4F\",\"expanded_url\":\"https://twitter.com/BarfussAK/status/1403391165739810816/photo/1\",\"display_url\":\"pic.twitter.com/1E8ID3sc4F\"}],\"hashtags\":[{\"start\":16,\"end\":28,\"tag\":\"IchbinHanna\"}],\"mentions\":[{\"start\":0,\"end\":15,\"username\":\"SebastianKubon\",\"id\":\"1244061463\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":2,\"reply_count\":1,\"like_count\":20,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"3_1403391156441001985\"]},\"conversation_id\":\"1403391165739810816\",\"source\":\"Twitter for iPhone\",\"in_reply_to_user_id\":\"1244061463\",\"created_at\":\"2021-06-11T16:38:22.000Z\",\"lang\":\"de\",\"author_id\":\"1926235711\"},{\"text\":\"Ich bin Sabrina. 2,5 Jahre Drittmittel befristet, 5 Mon. Abschlussstipendium, Diss eingereicht Okt 2017. Dann nur Lehraufträge, ein Jahr 50% wiss Mitt März 19-März 20, ein abgelehnter DFG Antrag, viele Bewerbungen. Seit 1.11.20 100% Habilstelle, 3+3 Jahre. Danach: ?? #IchbinHanna https://t.co/uJyRnvj7Sh\",\"id\":\"1402950417986863104\",\"entities\":{\"urls\":[{\"start\":281,\"end\":304,\"url\":\"https://t.co/uJyRnvj7Sh\",\"expanded_url\":\"https://twitter.com/S_Mittermeier/status/1402950417986863104/photo/1\",\"display_url\":\"pic.twitter.com/uJyRnvj7Sh\"}],\"hashtags\":[{\"start\":268,\"end\":280,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":22,\"reply_count\":7,\"like_count\":353,\"quote_count\":2},\"attachments\":{\"media_keys\":[\"3_1402950406817431556\"]},\"conversation_id\":\"1402950417986863104\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-10T11:26:59.000Z\",\"lang\":\"de\",\"author_id\":\"858060665797345280\"},{\"text\":\"Ich bin Lukas, Historiker. Ich promoviere zur Geschichte der Kritik an nuklearer Abschreckung. Zunächst als WHK jetzt mit Stipendium. Ich verstopfe die Wissenschaft, obwohl und weil ich jede Regel des Praktikums- und Berufsberaters gebrochen habe. #IchbinHanna \\n(#CoronaFrisur) https://t.co/PH3lKOjMZL\",\"id\":\"1402936727283642374\",\"entities\":{\"urls\":[{\"start\":278,\"end\":301,\"url\":\"https://t.co/PH3lKOjMZL\",\"expanded_url\":\"https://twitter.com/LukasMengelkamp/status/1402936727283642374/photo/1\",\"display_url\":\"pic.twitter.com/PH3lKOjMZL\"}],\"hashtags\":[{\"start\":248,\"end\":260,\"tag\":\"IchbinHanna\"},{\"start\":263,\"end\":276,\"tag\":\"CoronaFrisur\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":12,\"reply_count\":1,\"like_count\":149,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"3_1402936516880515073\"]},\"conversation_id\":\"1402936727283642374\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-10T10:32:35.000Z\",\"lang\":\"de\",\"author_id\":\"2961910996\"},{\"text\":\"In Deutschland trendet #IchBinHanna. Über 80% der WissenschaftlerInnen und Lehrenden haben befristete Verträge an Unis. In der Schweiz ist das genauso! Unterstütze die @ProAcademiaCH - mit Unterschrift online oder im Oktober vor dem Bundeshaus. #deliveroouniversity https://t.co/kyD7vYjAct\",\"id\":\"1403270056948158466\",\"entities\":{\"urls\":[{\"start\":266,\"end\":289,\"url\":\"https://t.co/kyD7vYjAct\",\"expanded_url\":\"https://twitter.com/LAjdacic/status/1403270056948158466/photo/1\",\"display_url\":\"pic.twitter.com/kyD7vYjAct\"}],\"hashtags\":[{\"start\":23,\"end\":35,\"tag\":\"IchBinHanna\"},{\"start\":245,\"end\":265,\"tag\":\"deliveroouniversity\"}],\"mentions\":[{\"start\":168,\"end\":182,\"username\":\"ProAcademiaCH\",\"id\":\"1308297750350565376\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":32,\"reply_count\":1,\"like_count\":74,\"quote_count\":5},\"attachments\":{\"media_keys\":[\"3_1403269987054276609\"]},\"conversation_id\":\"1403270056948158466\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-11T08:37:07.000Z\",\"lang\":\"de\",\"author_id\":\"775322571021615105\"},{\"text\":\"Letzte Woche waren wir mit 350 Leuten gemeinsam auf der Straße. Jetzt trendet #IchbinHanna \\n\\nWir verstopfen das Wissenschaftssystem nicht, wir halten es am Laufen! \\n\\nIn gemeinsamen Aktionen wächst Solidarität, entgegen Vereinzelung &amp; Wettbewerb propagiert im @BMBF_Bund Video https://t.co/DX0vmjXERL\",\"id\":\"1403300025749413895\",\"entities\":{\"urls\":[{\"start\":280,\"end\":303,\"url\":\"https://t.co/DX0vmjXERL\",\"expanded_url\":\"https://twitter.com/MittelbauIniHH/status/1403300025749413895/photo/1\",\"display_url\":\"pic.twitter.com/DX0vmjXERL\"},{\"start\":280,\"end\":303,\"url\":\"https://t.co/DX0vmjXERL\",\"expanded_url\":\"https://twitter.com/MittelbauIniHH/status/1403300025749413895/photo/1\",\"display_url\":\"pic.twitter.com/DX0vmjXERL\"}],\"hashtags\":[{\"start\":78,\"end\":90,\"tag\":\"IchbinHanna\"}],\"mentions\":[{\"start\":263,\"end\":273,\"username\":\"BMBF_Bund\",\"id\":\"2969727718\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":10,\"reply_count\":0,\"like_count\":31,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"3_1403299872464310274\",\"3_1403299872464326661\"]},\"conversation_id\":\"1403300025749413895\",\"source\":\"TweetDeck\",\"created_at\":\"2021-06-11T10:36:12.000Z\",\"lang\":\"de\",\"author_id\":\"1113378360162496512\"},{\"text\":\"wants to ruin your mood #IchbinHanna https://t.co/s1kZlOkXHz\",\"id\":\"1403084642912178176\",\"entities\":{\"urls\":[{\"start\":37,\"end\":60,\"url\":\"https://t.co/s1kZlOkXHz\",\"expanded_url\":\"https://twitter.com/SarahSinner1/status/1403084642912178176/photo/1\",\"display_url\":\"pic.twitter.com/s1kZlOkXHz\"}],\"hashtags\":[{\"start\":24,\"end\":36,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":true,\"public_metrics\":{\"retweet_count\":1,\"reply_count\":0,\"like_count\":5,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"16_1403084621944864770\"]},\"conversation_id\":\"1403084642912178176\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-10T20:20:21.000Z\",\"lang\":\"en\",\"author_id\":\"1106209092505427974\"},{\"text\":\"Auch wir sagen #IchbinHanna! Hanna gibt's nicht nur in der Wissenschaft, sondern auch in Verwaltung und Technik (wenn auch ohne #WissZeitVG). \\nWir laden alle Hannas und Lars der #unigöttingen ein, bei uns mitzumachen! Gemeinsam für eine umfassende Entfristung!✊ https://t.co/cZlXsYmSdY\",\"id\":\"1403296606938558470\",\"entities\":{\"urls\":[{\"start\":262,\"end\":285,\"url\":\"https://t.co/cZlXsYmSdY\",\"expanded_url\":\"https://twitter.com/GoeUnbefristet/status/1403296606938558470/video/1\",\"display_url\":\"pic.twitter.com/cZlXsYmSdY\"}],\"hashtags\":[{\"start\":15,\"end\":27,\"tag\":\"IchbinHanna\"},{\"start\":128,\"end\":139,\"tag\":\"WissZeitVG\"},{\"start\":178,\"end\":191,\"tag\":\"unigöttingen\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":11,\"reply_count\":1,\"like_count\":39,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"7_1403296123826151425\"]},\"conversation_id\":\"1403296606938558470\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-11T10:22:37.000Z\",\"lang\":\"de\",\"author_id\":\"1130451066670256129\"},{\"text\":\"Unter dem Hashtag #IchBinHanna erzählen Wissenschaftler, wie #WissZeitVG (Wissenschaftszeitvertragsgesetz) Ihnen die Karriere versaut.\\n\\nWie geht es Euch damit? https://t.co/r7jUV1xIS1\",\"id\":\"1403276215075717125\",\"entities\":{\"urls\":[{\"start\":160,\"end\":183,\"url\":\"https://t.co/r7jUV1xIS1\",\"expanded_url\":\"https://twitter.com/scienceslam/status/1403276215075717125/photo/1\",\"display_url\":\"pic.twitter.com/r7jUV1xIS1\"}],\"hashtags\":[{\"start\":18,\"end\":30,\"tag\":\"IchBinHanna\"},{\"start\":61,\"end\":72,\"tag\":\"WissZeitVG\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":4,\"reply_count\":3,\"like_count\":23,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"16_1403276207463018499\"]},\"conversation_id\":\"1403276215075717125\",\"source\":\"Twitter Web App\",\"created_at\":\"2021-06-11T09:01:35.000Z\",\"lang\":\"de\",\"author_id\":\"73069370\"},{\"text\":\"An die Leute die unter #ichbinhanna trollen, dass wir uns doch nen richtigen Job suchen sollen oder fragen warum nicht Staatsbürger noch hier sind: a) überlegt mal wer dann eure Lehrer*innen ausbildet, Museen füllt, euch Medieninhalte liefert. b): https://t.co/zEbGUzxp3u\",\"id\":\"1403340735294935040\",\"entities\":{\"urls\":[{\"start\":248,\"end\":271,\"url\":\"https://t.co/zEbGUzxp3u\",\"expanded_url\":\"https://twitter.com/S_Mittermeier/status/1403340735294935040/photo/1\",\"display_url\":\"pic.twitter.com/zEbGUzxp3u\"}],\"hashtags\":[{\"start\":23,\"end\":35,\"tag\":\"ichbinhanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":1,\"reply_count\":1,\"like_count\":36,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"16_1403340727288008711\"]},\"conversation_id\":\"1403340735294935040\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-11T13:17:58.000Z\",\"lang\":\"de\",\"author_id\":\"858060665797345280\"},{\"text\":\"Ich bin Svea, 40 Jahre alt, Soziologin. Promotion (2015) zum Thema Abbruchgedanken von Promovierenden. Fast 12 Jahre #Hochschulforschung. Derzeit GF eines Graduiertenzentrums, befristet bis November. Eine weitere Befristung an meiner Uni ist nicht möglich #IchbinHanna und du? https://t.co/sCyF26VO1T\",\"id\":\"1402968982647418885\",\"entities\":{\"urls\":[{\"start\":277,\"end\":300,\"url\":\"https://t.co/sCyF26VO1T\",\"expanded_url\":\"https://twitter.com/SveaKorff/status/1402968982647418885/photo/1\",\"display_url\":\"pic.twitter.com/sCyF26VO1T\"}],\"hashtags\":[{\"start\":117,\"end\":136,\"tag\":\"Hochschulforschung\"},{\"start\":256,\"end\":268,\"tag\":\"IchbinHanna\"}]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":23,\"reply_count\":12,\"like_count\":312,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"3_1402968973931593729\"]},\"conversation_id\":\"1402968982647418885\",\"source\":\"Twitter for iPhone\",\"created_at\":\"2021-06-10T12:40:46.000Z\",\"lang\":\"de\",\"author_id\":\"1059159563352637440\"},{\"text\":\"Hallo liebe Medienschaffende in meiner TL! \\uD83D\\uDE4B\\uD83C\\uDFFD‍♀️\\n\\nDer Hashtag #IchbinHanna trendet gerade &amp; offenbart die unhaltbaren Arbeitsbedingungen des wissenschaftlichen Nachwuchses.\\n\\nBitte informiert euch dazu + berichtet darüber, sofern das möglich ist! https://t.co/iVtslTVOQF\",\"id\":\"1403258228079792132\",\"entities\":{\"urls\":[{\"start\":250,\"end\":273,\"url\":\"https://t.co/iVtslTVOQF\",\"expanded_url\":\"https://twitter.com/_aylinkarabulut/status/1403258228079792132/photo/1\",\"display_url\":\"pic.twitter.com/iVtslTVOQF\"}],\"hashtags\":[